import React from 'react';


class Footer extends React.Component {
    render() {
        return (
            <footer>
            <div className="container">
                <div className="row">
                    <div className="col-lg-8 col-md-10 mx-auto">
                        <ul className="list-inline text-center">
                            <li className="list-inline-item">
                                <a href="#!">
                                  <button class=" big-button1"><img src="iconfinder_Instagram_7559936.png" width="20" height="20"/></button>
                                </a>
                            </li>
                            <li class="list-inline-item">
                                <a href="#!">
                                  <button class="btn1 big-button1"><img src="Search-512.png" width="20" height="20"/></button>
                                </a>
                            </li>
                        </ul>
                        <p class="copyright text-muted"><b>Copyright &copy; Your Website 2021</b></p>
                    </div>
                </div>
            </div>
          </footer>
        );
    }
}

export default Footer;
